import { Button, StyleSheet, TextInput, TouchableOpacity, TouchableHighlight, Image, Alert } from 'react-native';
import { Text, View } from '../components/Themed';
import { RootStackScreenProps } from '../../types';

const Login = ({ navigation }: RootStackScreenProps<'Login'>) => {

  const login = () => {
    console.log('LOGIN SUCCESSFUL')
  };

  return (
    <View style={styles.container}>
      <TouchableOpacity onPress={() => navigation.navigate('Home')}>
        <Text style={styles.title}>Go Home</Text>
      </TouchableOpacity>
      <View style={styles.inputContainer}>
        <TextInput
          style={styles.inputs}
          placeholder="Email"
          keyboardType="email-address"
          underlineColorAndroid="transparent"
          autoCapitalize="none"
        />
      </View>

      <View style={styles.inputContainer}>
        <TextInput
          style={styles.inputs}
          placeholder="Password"
          secureTextEntry={true}
          underlineColorAndroid="transparent"
          autoCapitalize="none"
        />
      </View>
      <TouchableHighlight
        style={[styles.buttonContainer, styles.loginButton]}
        onPress={() => login()}
      >
        <Text style={styles.loginText}>Login</Text>
      </TouchableHighlight>
      <View
        style={{
          display: 'flex'
        }}
      >
        <TouchableOpacity
          style={styles.buttonContainer}
          onPress={() => navigation.navigate('Signup')}
        >
          <Text>Signup</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
}
export default Login;


const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  title: {
    fontSize: 20,
    fontWeight: 'bold',
  },
  inputContainer: {
    backgroundColor: '#FFFFFF',
    borderRadius: 5,
    borderBottomWidth: 1,
    width: 620,
    height: 60,
    marginBottom: 20,
    flexDirection: 'row',
    alignItems: 'center'
  },
  inputs: {
    height: 60,
    flex: 1
  },
  buttonContainer: {
    justifyContent: 'center',
    alignItems: 'center',
    marginBottom: 20,
    width: 250,
    margin: 4,
    padding: 5,
    borderRadius: 5,
    borderWidth: 1,
    borderColor: '#A0DAB3',
    maxHeight: 100,
    alignSelf: 'center'
  },
  loginButton: {
    backgroundColor: '#A0DAB3'
  },
  loginText: {
    color: 'black'
  }
});
